import './Presentation.css';

function Presentation() {
  return(
    <section id='presentation-section' className='full-cover'>
      <hgroup id='presentation-text'>
        <h1>FRANCISCO MARIA</h1>
        <h3>Hi there,</h3>
        <h3>Glad you are here. Get to know me.</h3>
      </hgroup>
    </section>
  );
}

export default Presentation;
